import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

export default function Duenio() {
  return (
    <Box
      component="form"
      sx={{
        '& > :not(style)': { m: 1},
      }}
      noValidate
      autoComplete="off"
    >
      
      <TextField id="standard-basic" label="Nombre" variant="standard" />
      <TextField id="standard-basic" label="Numero" variant="standard" />
      <TextField id="standard-basic" label="Cant Mascotas" variant="standard" />
      <TextField id="standard-basic" label="Dirección" variant="standard" />
    </Box>
  );
}
